import React, { useEffect} from 'react';
import { Box, Card, CardActions, CardContent, CardMedia, Button, Typography } from '@mui/material';
import {
    Link,
    Route,
    Routes,
    useParams
} from "react-router-dom";


const Shop = ({ allData,isReady }) => {
    
    if (!isReady) 
    {
        return (
            <p>Loading.............</p>
        )
    }
    
        return (
            <Box className="sliderProduct">
                {
                    allData.map(e => (
                        <Card className="childElementCard">
                            <CardMedia
                                component="img"
                                alt="This is product"
                                className="imageCard"
                                image={e.images[2].imageUrl }
                            />
                            <CardContent>
                                <Typography
                                    gutterBottom
                                    variant="p"
                                    component="div">
                                  {e.foodName}
                                </Typography>
                            </CardContent>
                            <CardActions>
                
                <Button  
                                    variant="contained"
                                >Order now</Button>
                </CardActions>
                    </Card>
                ))
                    
              }
            </Box>
           
        )
};

export default Shop;
